import * as React from "react";
import logo from "../../logo.svg";
import { Navbar, Container, Form, Nav } from "react-bootstrap";
import "./Navbar.css";
import { FaLanguage, FaMapMarkerAlt } from "react-icons/fa";
import { Input, IconButton } from "@mui/material";
import  Avatar2  from "../../Images";
const navbarHome2 = () => {
  const imageSrc = Avatar2;
  return (
    <Navbar expand="lg" id="navbardb2">
      <Container fluid>
        <Navbar.Brand href="/In">
          <img src={logo} alt="Logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          ></Nav>

          <Form className="d-flex">
            <div className="box4navbarHome2">
              <FaLanguage
                size="20px"
                color="#808080"
                style={{ float: "left" }}
              />
              <p
                style={{
                  marginLeft: 10,
                  color: "#808080",
                  fontSize: 13,
                  float: "left",
                }}
              >
                EN
              </p>
            </div>

            <div className="box4navbarHome2">
              <FaMapMarkerAlt
                size="20px"
                color="#808080"
                style={{ float: "left" }}
              />
              <p
                style={{
                  marginLeft: 10,
                  color: "#808080",
                  fontSize: 13,
                  float: "left",
                }}
              >
                US
              </p>
            </div>

            <div className="box4navbarHome2_1" style={{ width: 40 }}>
              <div
                style={{
                  borderRadius: 100,
                  width: 100,
                  height: 100,
                  position: "relative",
                  borderWidth: 2,
                  margin: 25,
                }}
              >
                <label htmlFor="icon-button-file">
                  {/* {imageURLs.map((imageSrc, idx) => ( */}
                  <img
                    key={1}
                    src={imageSrc}
                    alt="imageURLs"
                    style={{
                      position: "absolute",
                      width: 90,
                      height: 90,
                      borderRadius: "100%",
                      top: -20,
                    }}
                  />
                  {/* ))} */}
                </label>
              </div>
            </div>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
export default navbarHome2;
